:"&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;1.&amp;lt;/strong&amp;gt; Smooth increase of &amp;lt;ins&amp;gt;surface temperature and evapotranspiration&amp;lt;/ins&amp;gt; towards the equator.\n&amp;lt;br&amp;gt;\n&amp;lt;strong&amp;gt;2.&amp;lt;/strong&amp;gt; &amp;lt;ins&amp;gt; Precipitation&amp;lt;/ins&amp;gt; has a steep decrease in tropical latitudes (+- 30 degrees). That could be due to the fact that the wind currents flow \nfrom the tropics to the Equator (intertropical convergence zone).\n&amp;lt;br&amp;gt;\n&amp;lt;strong&amp;gt;3.&amp;lt;/strong&amp;gt; &amp;lt;ins&amp;gt;High values of runoff&amp;lt;/ins&amp;gt; at high latitudes. &amp;lt;em&amp;gt;The group is unsure about what this could be but wondered if this could be\nrepresenting the melting ice. Nevertheless, we expected the runoff to be bigger between the tropics.&amp;lt;/em&amp;gt;&amp;lt;/p&amp;gt;","width":1200},"id":"166424","type":"panel.models.markup.HTML"},{"attributes":{"coordinates":null,"group":null,"text":"Time series for twice the [CO2] of pre-industrial levels (1958)","text_color":"black","text_font_size":"12pt"},"id":"163472","type":"Title"},{"attributes":{"data":{"Variable":["Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-Open Ocean","Doubled_CO2_2-O
